eval("\nif (false) // removed by dead control flow\n{}\nvar requireMap = {};\nvar requireInRuntimeBase = __webpack_require__(/*! ./node_modules/vue-styleguidist/lib/loaders/utils/client/requireInRuntime */ \"./node_modules/vue-styleguidist/lib/loaders/utils/client/requireInRuntime.js\");\nvar requireInRuntime = requireInRuntimeBase.bind(null, requireMap);\nvar evalInContextBase = __webpack_require__(/*! ./node_modules/vue-styleguidist/lib/loaders/utils/client/evalInContext */ \"./node_modules/vue-styleguidist/lib/loaders/utils/client/evalInContext.js\");\nvar evalInContext = evalInContextBase.bind(null, \n\t\"\", \n\tnull, null)\nmodule.exports = [{\n        'type': 'markdown',\n        'content': '### Adding Lux to your project\\n\\n#### Adding Lux to a vue+vite application\\n\\n[An example Vue+Vite application](https://github.com/pulibrary/vue-app-with-lux)\\nthat demonstrates [tree-shaking](https://developer.mozilla.org/en-US/docs/Glossary/Tree_shaking).\\n\\n1.  Add lux-design-system to your dependencies in package.json\\n\\n2.  In your main.js, import the LUX css:\\n\\n    ```ts\\n    <span class=\"token keyword\">import</span> <span class=\"token string\">\\'lux-design-system/dist/style.css\\'</span>\\n    ```\\n\\n3.  You can now import individual lux components into\\n    your application\\'s components.\\n\\nThe nice thing about this approach is that Vite will\\ntree-shake lux.  This way, your application bundle\\nwill only include the lux components that you\\nactually use, which means faster download times for the user.\\n\\n#### Adding Lux to a vite+rails project\\n\\nSome examples of this approach include [approvals](https://github.com/pulibrary/approvals) and\\n[DSS](https://github.com/pulibrary/DSS).\\n\\n1.  In your entrypoints/application.js file, add the import statements for lux and vue:\\n\\n    ```ts\\n    <span class=\"token keyword\">import</span> <span class=\"token punctuation\">{</span> createApp <span class=\"token punctuation\">}</span> <span class=\"token keyword\">from</span> <span class=\"token string\">\"vue\"</span><span class=\"token punctuation\">;</span>\\n    <span class=\"token keyword\">import</span> <span class=\"token string\">\"lux-design-system/dist/style.css\"</span><span class=\"token punctuation\">;</span>\\n\\n    <span class=\"token comment\">// Option 1: import the default export from</span>\\n    <span class=\"token comment\">// lux to import all of lux into your project</span>\\n    <span class=\"token keyword\">import</span> lux <span class=\"token keyword\">from</span> <span class=\"token string\">\"lux-design-system\"</span><span class=\"token punctuation\">;</span>\\n\\n    <span class=\"token comment\">// Option 2: import only the components you</span>\\n    <span class=\"token comment\">// need from lux, to enable tree-shaking and</span>\\n    <span class=\"token comment\">// a smaller bundle size</span>\\n    <span class=\"token keyword\">import</span> <span class=\"token punctuation\">{</span> LuxLibraryFooter<span class=\"token punctuation\">,</span> LuxLibraryHeader<span class=\"token punctuation\">,</span> LuxMenuBar<span class=\"token punctuation\">,</span> LuxLogoUniversity<span class=\"token punctuation\">,</span> LuxLogoLibraryIcon<span class=\"token punctuation\">,</span> LuxLibraryLogo<span class=\"token punctuation\">,</span> LuxLogoLibrary<span class=\"token punctuation\">,</span> LuxWrapper<span class=\"token punctuation\">,</span> LuxSpacer <span class=\"token punctuation\">}</span> <span class=\"token keyword\">from</span> <span class=\"token string\">\"lux-design-system\"</span><span class=\"token punctuation\">;</span>\\n    ```\\n\\n2.  In your entrypoints/application.js, create a factory function\\n    for creating vue apps:\\n\\n    ```ts\\n    <span class=\"token keyword\">const</span> app <span class=\"token operator\">=</span> <span class=\"token function\">createApp</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">{</span><span class=\"token punctuation\">}</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">;</span>\\n    <span class=\"token keyword\">const</span> <span class=\"token function-variable function\">createMyApp</span> <span class=\"token operator\">=</span> <span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span> <span class=\"token operator\">=></span> <span class=\"token function\">createApp</span><span class=\"token punctuation\">(</span>app<span class=\"token punctuation\">)</span><span class=\"token punctuation\">;</span>\\n    ```\\n\\n3.  In your entrypoints/application.js, use the lux plugin (if you chose option 1 above) or add the specific components your\\n    Rails app uses (if you chose option 2 above).  Then mount the\\n    Vue app to the appropriate element(s) in the DOM.\\n\\n    ```ts\\n    document<span class=\"token punctuation\">.</span><span class=\"token function\">addEventListener</span><span class=\"token punctuation\">(</span><span class=\"token string\">\\'DOMContentLoaded\\'</span><span class=\"token punctuation\">,</span> <span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span> <span class=\"token operator\">=></span> <span class=\"token punctuation\">{</span>\\n        <span class=\"token keyword\">const</span> elements <span class=\"token operator\">=</span> document<span class=\"token punctuation\">.</span><span class=\"token function\">getElementsByClassName</span><span class=\"token punctuation\">(</span><span class=\"token string\">\\'lux\\'</span><span class=\"token punctuation\">)</span>\\n        <span class=\"token keyword\">for</span> <span class=\"token punctuation\">(</span><span class=\"token keyword\">let</span> i <span class=\"token operator\">=</span> <span class=\"token number\">0</span><span class=\"token punctuation\">;</span> i <span class=\"token operator\">&lt;</span> elements<span class=\"token punctuation\">.</span>length<span class=\"token punctuation\">;</span> i<span class=\"token operator\">++</span><span class=\"token punctuation\">)</span> <span class=\"token punctuation\">{</span>\\n            <span class=\"token comment\">// Option 1: use all of lux</span>\\n            <span class=\"token function\">createMyApp</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span>\\n                <span class=\"token punctuation\">.</span><span class=\"token function\">use</span><span class=\"token punctuation\">(</span>lux<span class=\"token punctuation\">)</span>\\n                <span class=\"token punctuation\">.</span><span class=\"token function\">mount</span><span class=\"token punctuation\">(</span>elements<span class=\"token punctuation\">[</span>i<span class=\"token punctuation\">]</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">;</span>\\n\\n            <span class=\"token comment\">// OR option 2: use specific lux components</span>\\n            <span class=\"token function\">createMyApp</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span>\\n                <span class=\"token punctuation\">.</span><span class=\"token function\">component</span><span class=\"token punctuation\">(</span><span class=\"token string\">\"lux-library-footer\"</span><span class=\"token punctuation\">,</span> LuxLibraryFooter<span class=\"token punctuation\">)</span>\\n                <span class=\"token punctuation\">.</span><span class=\"token function\">component</span><span class=\"token punctuation\">(</span><span class=\"token string\">\"lux-library-header\"</span><span class=\"token punctuation\">,</span> LuxLibraryHeader<span class=\"token punctuation\">)</span>\\n                <span class=\"token punctuation\">.</span><span class=\"token function\">component</span><span class=\"token punctuation\">(</span><span class=\"token string\">\"lux-menu-bar\"</span><span class=\"token punctuation\">,</span> LuxMenuBar<span class=\"token punctuation\">)</span>\\n                <span class=\"token punctuation\">.</span><span class=\"token function\">component</span><span class=\"token punctuation\">(</span><span class=\"token string\">\"lux-logo-university\"</span><span class=\"token punctuation\">,</span> LuxLogoUniversity<span class=\"token punctuation\">)</span>\\n                <span class=\"token punctuation\">.</span><span class=\"token function\">component</span><span class=\"token punctuation\">(</span><span class=\"token string\">\"lux-logo-library-icon\"</span><span class=\"token punctuation\">,</span> LuxLogoLibraryIcon<span class=\"token punctuation\">)</span>\\n                <span class=\"token punctuation\">.</span><span class=\"token function\">component</span><span class=\"token punctuation\">(</span><span class=\"token string\">\"lux-library-logo\"</span><span class=\"token punctuation\">,</span> LuxLibraryLogo<span class=\"token punctuation\">)</span>\\n                <span class=\"token punctuation\">.</span><span class=\"token function\">component</span><span class=\"token punctuation\">(</span><span class=\"token string\">\"lux-logo-library\"</span><span class=\"token punctuation\">,</span> LuxLogoLibrary<span class=\"token punctuation\">)</span>\\n                <span class=\"token punctuation\">.</span><span class=\"token function\">component</span><span class=\"token punctuation\">(</span><span class=\"token string\">\"lux-wrapper\"</span><span class=\"token punctuation\">,</span> LuxWrapper<span class=\"token punctuation\">)</span>\\n                <span class=\"token punctuation\">.</span><span class=\"token function\">component</span><span class=\"token punctuation\">(</span><span class=\"token string\">\"lux-spacer\"</span><span class=\"token punctuation\">,</span> LuxSpacer<span class=\"token punctuation\">)</span>\\n                <span class=\"token punctuation\">.</span><span class=\"token function\">mount</span><span class=\"token punctuation\">(</span>elements<span class=\"token punctuation\">[</span>i<span class=\"token punctuation\">]</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">;</span>\\n        <span class=\"token punctuation\">}</span>\\n    <span class=\"token punctuation\">}</span><span class=\"token punctuation\">)</span>\\n    ```\\n\\n4.  Add lux components as needed in your views or ViewComponents.\\n\\n5.  Add classes or CSS variables from lux to your styling.\\n\\n#### Adding Lux to a static HTML page\\n\\nImportmaps are a nice way to add vue and\\nlux to a static site.  An example of this\\napproach is the [Pulibrary github blog](https://github.com/pulibrary/pulibrary.github.io).\\n\\nThis approach is simple, but there is a drawback.\\nThe user has to download all of lux, rather than\\njust the components you need (i.e. there is no\\ntree shaking).\\n\\n1.  In your HTML, import Vue and lux from a\\n    CDN, like so:\\n\\n    ```html\\n    <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>script</span> <span class=\"token attr-name\">type</span><span class=\"token attr-value\"><span class=\"token punctuation attr-equals\">=</span><span class=\"token punctuation\">\"</span>importmap<span class=\"token punctuation\">\"</span></span><span class=\"token punctuation\">></span></span><span class=\"token script\"><span class=\"token language-javascript\">\\n      <span class=\"token punctuation\">{</span>\\n        <span class=\"token string-property property\">\"imports\"</span><span class=\"token operator\">:</span> <span class=\"token punctuation\">{</span>\\n          <span class=\"token string-property property\">\"vue\"</span><span class=\"token operator\">:</span> <span class=\"token string\">\"https://unpkg.com/vue@3.2.47/dist/vue.esm-browser.prod.js\"</span><span class=\"token punctuation\">,</span>\\n          <span class=\"token string-property property\">\"lux-design-system\"</span><span class=\"token operator\">:</span> <span class=\"token string\">\"https://unpkg.com/lux-design-system@6.3.1/dist/lux-styleguidist.mjs\"</span>\\n        <span class=\"token punctuation\">}</span>\\n      <span class=\"token punctuation\">}</span>\\n    </span></span><span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>script</span><span class=\"token punctuation\">></span></span>\\n    ```\\n\\n2.  Add some javascript that creates and mounts a\\n    Vue application and installs lux as a vue plugin.\\n\\n    ```ts\\n    <span class=\"token keyword\">import</span> <span class=\"token punctuation\">{</span> createApp <span class=\"token punctuation\">}</span> <span class=\"token keyword\">from</span> <span class=\"token string\">\\'vue\\'</span><span class=\"token punctuation\">;</span>\\n    <span class=\"token keyword\">import</span> lux <span class=\"token keyword\">from</span> <span class=\"token string\">\\'lux-design-system\\'</span><span class=\"token punctuation\">;</span>\\n\\n    <span class=\"token keyword\">const</span> app <span class=\"token operator\">=</span> <span class=\"token function\">createApp</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">{</span><span class=\"token punctuation\">}</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">;</span>\\n    app<span class=\"token punctuation\">.</span><span class=\"token function\">use</span><span class=\"token punctuation\">(</span>lux<span class=\"token punctuation\">)</span>\\n    <span class=\"token punctuation\">.</span><span class=\"token function\">mount</span><span class=\"token punctuation\">(</span><span class=\"token string\">\\'#app\\'</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">;</span>\\n    ```\\n\\n    If you are only using lux for a header and footer:\\n\\n    ```ts\\n    <span class=\"token keyword\">import</span> <span class=\"token punctuation\">{</span> createApp <span class=\"token punctuation\">}</span> <span class=\"token keyword\">from</span> <span class=\"token string\">\\'vue\\'</span><span class=\"token punctuation\">;</span>\\n    <span class=\"token keyword\">import</span> lux <span class=\"token keyword\">from</span> <span class=\"token string\">\\'lux-design-system\\'</span><span class=\"token punctuation\">;</span>\\n\\n    <span class=\"token keyword\">const</span> headerApp <span class=\"token operator\">=</span> <span class=\"token function\">createApp</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">{</span><span class=\"token punctuation\">}</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">;</span>\\n    headerApp<span class=\"token punctuation\">.</span><span class=\"token function\">use</span><span class=\"token punctuation\">(</span>lux<span class=\"token punctuation\">)</span>\\n    <span class=\"token punctuation\">.</span><span class=\"token function\">mount</span><span class=\"token punctuation\">(</span><span class=\"token string\">\\'#lux-header-container\\'</span><span class=\"token punctuation\">)</span>\\n\\n    <span class=\"token keyword\">const</span> footerApp <span class=\"token operator\">=</span> <span class=\"token function\">createApp</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">{</span><span class=\"token punctuation\">}</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">;</span>\\n    footerApp<span class=\"token punctuation\">.</span><span class=\"token function\">use</span><span class=\"token punctuation\">(</span>lux<span class=\"token punctuation\">)</span>\\n    <span class=\"token punctuation\">.</span><span class=\"token function\">mount</span><span class=\"token punctuation\">(</span><span class=\"token string\">\\'#lux-footer-container\\'</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">;</span>\\n    ```\\n\\n3.  Import the CSS as from a CDN.\\n\\n    ```html\\n    <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>link</span> <span class=\"token attr-name\">rel</span><span class=\"token attr-value\"><span class=\"token punctuation attr-equals\">=</span><span class=\"token punctuation\">\"</span>stylesheet<span class=\"token punctuation\">\"</span></span> <span class=\"token attr-name\">href</span><span class=\"token attr-value\"><span class=\"token punctuation attr-equals\">=</span><span class=\"token punctuation\">\"</span>https://unpkg.com/lux-design-system@6.3.1/dist/style.css<span class=\"token punctuation\">\"</span></span><span class=\"token punctuation\">></span></span>\\n    ```\\n\\n4.  Add lux components as needed in your HTML.  If you are just adding a\\n    header and footer:\\n\\n    ```html\\n    <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>div</span> <span class=\"token attr-name\">id</span><span class=\"token attr-value\"><span class=\"token punctuation attr-equals\">=</span><span class=\"token punctuation\">\"</span>lux-header-container<span class=\"token punctuation\">\"</span></span><span class=\"token punctuation\">></span></span>\\n     <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>lux-library-header</span> <span class=\"token attr-name\">app-name</span><span class=\"token attr-value\"><span class=\"token punctuation attr-equals\">=</span><span class=\"token punctuation\">\"</span>Research Guides<span class=\"token punctuation\">\"</span></span> <span class=\"token attr-name\">abbr-name</span><span class=\"token attr-value\"><span class=\"token punctuation attr-equals\">=</span><span class=\"token punctuation\">\"</span>Guides<span class=\"token punctuation\">\"</span></span> <span class=\"token attr-name\">app-url</span><span class=\"token attr-value\"><span class=\"token punctuation attr-equals\">=</span><span class=\"token punctuation\">\"</span>https://libguides.princeton.edu/<span class=\"token punctuation\">\"</span></span> <span class=\"token attr-name\">theme</span><span class=\"token attr-value\"><span class=\"token punctuation attr-equals\">=</span><span class=\"token punctuation\">\"</span>dark<span class=\"token punctuation\">\"</span></span><span class=\"token punctuation\">></span></span>\\n       <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>lux-menu-bar</span> <span class=\"token attr-name\">type</span><span class=\"token attr-value\"><span class=\"token punctuation attr-equals\">=</span><span class=\"token punctuation\">\"</span>main-menu<span class=\"token punctuation\">\"</span></span> <span class=\"token attr-name\">:menu-items</span><span class=\"token attr-value\"><span class=\"token punctuation attr-equals\">=</span><span class=\"token punctuation\">\"</span>[\\n           {name: \\'Help\\', component: \\'Help\\', href: \\'https://library.princeton.edu/ask-us\\'},\\n           {name: \\'Your Accounts\\', component: \\'Account\\', href: \\'https://library.princeton.edu/accounts\\'}\\n         ]<span class=\"token punctuation\">\"</span></span>\\n       <span class=\"token punctuation\">></span></span><span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>lux-menu-bar</span><span class=\"token punctuation\">></span></span>\\n     <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>lux-library-header</span><span class=\"token punctuation\">></span></span>\\n\\n     <span class=\"token comment\">&lt;!-- the rest of your page --></span>\\n\\n     <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>div</span> <span class=\"token attr-name\">id</span><span class=\"token attr-value\"><span class=\"token punctuation attr-equals\">=</span><span class=\"token punctuation\">\"</span>lux-footer-container<span class=\"token punctuation\">\"</span></span><span class=\"token punctuation\">></span></span>\\n       <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>lux-library-footer</span><span class=\"token punctuation\">></span></span><span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>lux-library-footer</span><span class=\"token punctuation\">></span></span>\\n     <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>div</span><span class=\"token punctuation\">></span></span>\\n    ```\\n\\n5.  Add classes or CSS variables from lux to your styling.\\n\\n##### Adding Lux to a static HTML page using an IIFE file\\n\\nIf you can\\'t use an import map and have to use `<script src>` then from cdn use the IIFE file - `https://unpkg.com/lux-design-system@<versionNumber>/dist/lux-styleguidist.iife.js`.\\n\\nAdd the following `<script>` tags after the `<head>` tag:\\n\\n```html\\n  <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>script</span> <span class=\"token attr-name\">src</span><span class=\"token attr-value\"><span class=\"token punctuation attr-equals\">=</span><span class=\"token punctuation\">\"</span>https://unpkg.com/vue@3/dist/vue.global.js<span class=\"token punctuation\">\"</span></span><span class=\"token punctuation\">></span></span><span class=\"token script\"></span><span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>script</span><span class=\"token punctuation\">></span></span>\\n  <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>script</span> <span class=\"token attr-name\">src</span><span class=\"token attr-value\"><span class=\"token punctuation attr-equals\">=</span><span class=\"token punctuation\">\"</span>https://unpkg.com/lux-design-system@6.3.1/dist/lux-styleguidist.iife.js<span class=\"token punctuation\">\"</span></span><span class=\"token punctuation\">></span></span><span class=\"token script\"></span><span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>script</span><span class=\"token punctuation\">></span></span>\\n```\\n\\nAfter `<body>` tag add the following `<script>` tag:\\n\\n```html\\n<span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>script</span><span class=\"token punctuation\">></span></span><span class=\"token script\"><span class=\"token language-javascript\">\\n    <span class=\"token keyword\">const</span> <span class=\"token punctuation\">{</span> createApp <span class=\"token punctuation\">}</span> <span class=\"token operator\">=</span> Vue\\n    <span class=\"token function\">createApp</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">.</span><span class=\"token function\">use</span><span class=\"token punctuation\">(</span>Lux<span class=\"token punctuation\">.</span>default<span class=\"token punctuation\">)</span><span class=\"token punctuation\">.</span><span class=\"token function\">mount</span><span class=\"token punctuation\">(</span><span class=\"token string\">\\'#app\\'</span><span class=\"token punctuation\">)</span>\\n</span></span><span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>script</span><span class=\"token punctuation\">></span></span>\\n```\\n\\n#### Adding only the Lux CSS\\n\\nYou can just bring in the lux CSS (including all the CSS variables) from a CDN.\\nAn example of this approach is the [DACS handbook](https://github.com/pulibrary/dacs_handbook).\\n\\nTo do this, add the CSS from a CDN to your HTML:\\n\\n```html\\n    <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>link</span> <span class=\"token attr-name\">rel</span><span class=\"token attr-value\"><span class=\"token punctuation attr-equals\">=</span><span class=\"token punctuation\">\"</span>stylesheet<span class=\"token punctuation\">\"</span></span> <span class=\"token attr-name\">href</span><span class=\"token attr-value\"><span class=\"token punctuation attr-equals\">=</span><span class=\"token punctuation\">\"</span>https://unpkg.com/lux-design-system@6.3.1/dist/style.css<span class=\"token punctuation\">\"</span></span><span class=\"token punctuation\">></span></span>\\n```'\n    }]\n\n//# sourceURL=webpack://lux-design-system/./docs/adding_lux.md?./node_modules/vue-styleguidist/lib/loaders/examples-loader.js?customLangs=vue%7Cjs%7Cjsx");

